[{"location":"advection_diffusion_1d/advection_diffusion_1d/#One-dimensional-linear-advection-diffusion-example","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"","category":"section"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"We first need to load StableSpectralElements.jl and OrdinaryDiffEq, which handle the spatial and temporal components of the discretization, respectively. The packages on the second line are used in this example for visualization and displaying timing information.","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"using StableSpectralElements, OrdinaryDiffEq\nusing Plots, Plots.PlotMeasures, Printf, TimerOutputs","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"We will solve the one-dimensional linear advection-diffusion equation $ \\partialt U(x,t) + \\partialx (a U(x,t) - b \\partial_x U(x,t)) = 0,  \\quad \\forall\\, (x, t) \\in (0,L) \\times (0,T), $ with a = 1, b = 5 times 10^-2, L = 1, and T = 1, imposing periodic boundary conditions as well as the initial condition $ U(x,0) = \\sin(2\\pi x), \\quad \\forall \\, x \\in (0,L). $","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"a = 1.0  # wave speed\nb = 5.0e-2  # diffusion coefficient\nL = 1.0  # domain length\nT = 1.0  # end time for one period\n\nconservation_law = LinearAdvectionDiffusionEquation(a,b)\ninitial_data = InitialDataSine(1.0,2π)\nexact_solution = ExactSolution(conservation_law,initial_data);","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"The problem described above will be discretized using a standard weak-form DG method of NodalTensor type on a uniform mesh with M = 4 elements of degree p = 4.","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"M = 4\np = 4\nform = StandardForm()\n\nreference_approximation = ReferenceApproximation(\n    NodalTensor(p), Line())\n\nmesh = uniform_periodic_mesh(reference_approximation, (0.0,L), M)\n\nspatial_discretization = SpatialDiscretization(mesh, \n    reference_approximation);","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"We'll now save the project. This sets up a directory where intermediate solution files are saved, and allows the simulation to be resumed from a previous state.","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"results_path = save_project(conservation_law,\n     spatial_discretization, initial_data, form, (0.0, T),\n     \"results/advection_diffusion_1d/\");","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"The function semidiscretize sets up the solver using the above parameters and uses it to construct an ODEProblem object. We can then use solve from OrdinaryDiffEq.jl to integrate in time. The five-stage, fourth-order low-storage explicit Runge-Kutta method from Carpenter and Kennedy is used for such a purpose. We use save_callback to write the solution to file 50 times during the course of the simulation.","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"ode_problem = semidiscretize(conservation_law,\n    spatial_discretization,\n    initial_data, \n    form,\n    (0.0, T), \n    PhysicalOperator())\n\nCFL = 0.1\nh = L / (reference_approximation.N_p * spatial_discretization.N_e)\ndt = CFL * h / a\n\nreset_timer!()\nsol = solve(ode_problem, CarpenterKennedy2N54(), adaptive=false, dt=dt,\n    save_everystep=false, callback=save_callback(results_path, (0.0,T),  \n        floor(Int, T/(dt*50))))\nprint_timer()","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"\u001b[0m\u001b[1m ────────────────────────────────────────────────────────────────────\u001b[22m\n\u001b[0m\u001b[1m                   \u001b[22m         Time                    Allocations      \n                   ───────────────────────   ────────────────────────\n Tot / % measured:     93.6ms /  66.0%           20.3MiB /  88.0%    \n\n Section   ncalls     time    %tot     avg     alloc    %tot      avg\n ────────────────────────────────────────────────────────────────────\n rhs        1.07k   61.8ms  100.0%  57.8μs   17.8MiB  100.0%  17.1KiB\n\u001b[0m\u001b[1m ────────────────────────────────────────────────────────────────────\u001b[22m","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"The L^2 norm of the error in the numerical solution can now be approximated, where we use an over-integrated quadrature rule in this case.","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"error_analysis = ErrorAnalysis(results_path, conservation_law, \n    spatial_discretization, LGQuadrature(p+2))\nprintln(\"L2 error:\")\nprintln(analyze(error_analysis, last(sol.u), exact_solution, T)...)","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"L2 error:\n1.1862542436134625e-5","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"Using the snapshots taken during the simulation, the discrete conservation and energy functionals can be evaluated, corresponding to the discrete approximations of int_0^L U(xt)  mathrmd x and tfrac12int_0^L U(xt)^2  mathrmd x, respectively. Note that the conservation functional remains constant up to machine precision, while the energy functional is nonincreasing for all time.","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"conservation_analysis = PrimaryConservationAnalysis(results_path, \n    conservation_law, spatial_discretization)\nenergy_analysis = EnergyConservationAnalysis(results_path, \n    conservation_law, spatial_discretization)\np1 = plot(analyze(conservation_analysis, load_time_steps(results_path)), \n    ylabel=\"Conservation Functional\")\np2 = plot(analyze(energy_analysis, load_time_steps(results_path)), \n    ylabel=\"Energy Functional\");\nplot(p1,p2, size=(600,300),margin=5mm, fmt=:png)","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"<img src=\"data:image/png;base64,\" />","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"We can plot the numerical solution at time t = T and compare it to the analytical solution.","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"plot(spatial_discretization, last(sol.u), \n    exact_solution=exact_solution, time=T, ylims=[-1.0,1.0], fmt=:png)","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"<img src=\"data:image/png;base64,\" />","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"Such plots can then be used to create an animation as shown below. We'll save it as a .gif file.","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"anim = @animate for i ∈ eachindex(sol.u)\n    plot(spatial_discretization, sol.u[i], \n        ylims=[-1.0,1.0], ylabel=\"\\$U^h(x,t)\\$\",\n        label=string(\"\\$t = \\$\", @sprintf \"\\$%.2f\\$\" sol.t[i]))\nend\ngif(anim, \"advection_diffusion_solution.gif\", fps = 10)","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"\u001b[36m\u001b[1m[ \u001b[22m\u001b[39m\u001b[36m\u001b[1mInfo: \u001b[22m\u001b[39mSaved animation to /Users/tristanmontoya/Research/StableSpectralElements.jl/examples/advection_diffusion_solution.gif","category":"page"},{"location":"advection_diffusion_1d/advection_diffusion_1d/","page":"One-dimensional linear advection-diffusion example","title":"One-dimensional linear advection-diffusion example","text":"<img src=\"data:image/gif;base64,\" />","category":"page"},{"location":"SpatialDiscretizations/#Module-SpatialDiscretizations","page":"SpatialDiscretizations","title":"Module SpatialDiscretizations","text":"","category":"section"},{"location":"SpatialDiscretizations/#Overview","page":"SpatialDiscretizations","title":"Overview","text":"","category":"section"},{"location":"SpatialDiscretizations/","page":"SpatialDiscretizations","title":"SpatialDiscretizations","text":"Discretizations in StableSpectralElements.jl are constructed by first building a local approximation on a canonical reference element, denoted generically as hatOmega subset mathbbR^d, and using a bijective transformation bmX^(kappa)  hatOmega rightarrow Omega^(kappa) to construct the approximation on each physical element of the mesh mathcalT^h =  Omega^(kappa)_kappa in 1N_e in terms of the associated operators on the reference element. An example of such a mapping is shown below.","category":"page"},{"location":"SpatialDiscretizations/","page":"SpatialDiscretizations","title":"SpatialDiscretizations","text":"(Image: Mesh mapping)","category":"page"},{"location":"SpatialDiscretizations/","page":"SpatialDiscretizations","title":"SpatialDiscretizations","text":"In order to define the different geometric reference elements, existing subtypes of AbstractElemShape from StartUpDG.jl (e.g. Line, Quad, Hex, Tri, and Tet) are used and re-exported by StableSpectralElements.jl. For example, we have ","category":"page"},{"location":"SpatialDiscretizations/","page":"SpatialDiscretizations","title":"SpatialDiscretizations","text":"beginaligned\nhatOmega_mathrmline = -11\nhatOmega_mathrmquad = -11^2\nhatOmega_mathrmhex  = -11^3 \nhatOmega_mathrmtri = big bmxi in -11^2  xi_1 + xi_2 leq 0 big\nhatOmega_mathrmtet = big bmxi in -11^3  xi_1 + xi_2 + xi_3 leq -1 big\nendaligned","category":"page"},{"location":"SpatialDiscretizations/","page":"SpatialDiscretizations","title":"SpatialDiscretizations","text":"These element types are used in the constructor for StableSpectralElements.jl's ReferenceApproximation type, along with a subtype of AbstractApproximationType specifying the nature of the local approximation (and, optionally, the associated volume and facet quadrature rules).","category":"page"},{"location":"SpatialDiscretizations/","page":"SpatialDiscretizations","title":"SpatialDiscretizations","text":"All the information used to define the spatial discretization on the physical domain Omega is contained within a SpatialDiscretization structure, which is constructed using a ReferenceApproximation and a MeshData from StartUpDG.jl, which are stored as the fields reference_approximation and mesh. When the constructor for a SpatialDiscretization is called, the grid metrics are computed and stored in a GeometricFactors structure, with the corresponding field being geometric_factors. ","category":"page"},{"location":"ConservationLaws/#Module-ConservationLaws","page":"ConservationLaws","title":"Module ConservationLaws","text":"","category":"section"},{"location":"ConservationLaws/#Overview","page":"ConservationLaws","title":"Overview","text":"","category":"section"},{"location":"ConservationLaws/","page":"ConservationLaws","title":"ConservationLaws","text":"The equations to be solved are defined by subtypes of AbstractConservationLaw on which functions such as physical_flux and numerical_flux are dispatched. Objects of type AbstractConservationLaw contain two type parameters, d and PDEType, the former denoting the spatial dimension of the problem, which is inherited by all subtypes, and the latter being a subtype of AbstractPDEType denoting the particular type of PDE being solved, which is either FirstOrder or SecondOrder. Whereas first-order problems remove the dependence of the flux tensor on the solution gradient in order to obtain systems of the form","category":"page"},{"location":"ConservationLaws/","page":"ConservationLaws","title":"ConservationLaws","text":"partial_t underlineU(bmxt) + bmnabla_bmx cdot underlinebmF(underlineU(bmxt)) = underline0","category":"page"},{"location":"ConservationLaws/","page":"ConservationLaws","title":"ConservationLaws","text":"second-order problems are treated by StableSpectralElements.jl as first-order systems of the form ","category":"page"},{"location":"ConservationLaws/","page":"ConservationLaws","title":"ConservationLaws","text":"beginaligned\nunderlinebmQ(bmxt) - bmnabla_bmx underlineU(bmxt) = underline0\npartial_t underlineU(bmxt) + bmnabla_bmx cdot underlinebmF(underlineU(bmxt) underlinebmQ(bmxt)) = underline0\nendaligned","category":"page"},{"location":"ConservationLaws/","page":"ConservationLaws","title":"ConservationLaws","text":"Currently, the linear advection and advection-diffusion equations, the inviscid and viscous Burgers' equations, and the compressible Euler equations are supported by StableSpectralElements.jl, but any system of the above form can in principle be implemented, provided that appropriate physical and numerical fluxes are defined.","category":"page"},{"location":"ConservationLaws/#Equations","page":"ConservationLaws","title":"Equations","text":"","category":"section"},{"location":"ConservationLaws/","page":"ConservationLaws","title":"ConservationLaws","text":"Listed below are partial differential equations supported by StableSpectralElements.jl.","category":"page"},{"location":"ConservationLaws/","page":"ConservationLaws","title":"ConservationLaws","text":"CurrentModule = ConservationLaws","category":"page"},{"location":"ConservationLaws/","page":"ConservationLaws","title":"ConservationLaws","text":"    LinearAdvectionEquation\n    LinearAdvectionDiffusionEquation\n    InviscidBurgersEquation\n    ViscousBurgersEquation\n    EulerEquations","category":"page"},{"location":"ConservationLaws/#StableSpectralElements.ConservationLaws.LinearAdvectionEquation","page":"ConservationLaws","title":"StableSpectralElements.ConservationLaws.LinearAdvectionEquation","text":"LinearAdvectionEquation(a::NTuple{d,Float64}) where {d}\n\nDefine a linear advection equation of the form\n\npartial_t U(bmxt) + bmnabla cdot big( bma U(bmxt) big) = 0\n\nwith a constant advection velocity bma in R^d. A specialized constructor LinearAdvectionEquation(a::Float64) is provided for the one-dimensional case.\n\n\n\n\n\n","category":"type"},{"location":"ConservationLaws/#StableSpectralElements.ConservationLaws.LinearAdvectionDiffusionEquation","page":"ConservationLaws","title":"StableSpectralElements.ConservationLaws.LinearAdvectionDiffusionEquation","text":"LinearAdvectionDiffusionEquation(a::NTuple{d,Float64}, b::Float64) where {d}\n\nDefine a linear advection-diffusion equation of the form\n\npartial_t U(bmxt) + bmnabla cdot big( bma U(bmxt) - b bmnabla U(bmxt)big) = 0\n\nwith a constant advection velocity bma in R^d and diffusion coefficient b in R^+. A specialized constructor LinearAdvectionDiffusionEquation(a::Float64, b::Float64) is provided for the one-dimensional case.\n\n\n\n\n\n","category":"type"},{"location":"ConservationLaws/#StableSpectralElements.ConservationLaws.InviscidBurgersEquation","page":"ConservationLaws","title":"StableSpectralElements.ConservationLaws.InviscidBurgersEquation","text":"InviscidBurgersEquation(a::NTuple{d,Float64}) where {d}\n\nDefine an inviscid Burgers' equation of the form\n\npartial_t U(bmxt) + bmnabla cdot big(tfrac12bma U(bmxt)^2 big) = 0\n\nwhere bma in R^d. A specialized constructor InviscidBurgersEquation() is provided for the one-dimensional case with a = (1.0,).\n\n\n\n\n\n","category":"type"},{"location":"ConservationLaws/#StableSpectralElements.ConservationLaws.ViscousBurgersEquation","page":"ConservationLaws","title":"StableSpectralElements.ConservationLaws.ViscousBurgersEquation","text":"ViscousBurgersEquation(a::NTuple{d,Float64}, b::Float64) where {d}\n\nDefine a viscous Burgers' equation of the form\n\npartial_t U(bmxt) + bmnabla cdot big(tfrac12bma U(bmxt)^2 - b bmnabla U(bmxt)big) = 0\n\nwhere bma in R^d and b in R^+. A specialized constructor ViscousBurgersEquation(b::Float64) is provided for the one-dimensional case with a = (1.0,).\n\n\n\n\n\n","category":"type"},{"location":"ConservationLaws/#StableSpectralElements.ConservationLaws.EulerEquations","page":"ConservationLaws","title":"StableSpectralElements.ConservationLaws.EulerEquations","text":"EulerEquations{d}(γ::Float64) where {d}\n\nDefine an Euler system governing compressible, adiabatic fluid flow, taking the form\n\nfracpartialpartial tleftbeginarrayc\nrho(bmx t) \nrho(bmx t) V_1(bmx t) \nvdots \nrho(bmx t) V_d(bmx t) \nE(bmx t)\nendarrayright+sum_m=1^d fracpartialpartial x_mleftbeginarrayc\nrho(bmx t) V_m(bmx t) \nrho(bmx t) V_1(bmx t) V_m(bmx t)+P(bmx t) delta_1 m \nvdots \nrho(bmx t) V_d(bmx t) V_m(bmx t)+P(bmx t) delta_d m \nV_m(bmx t)(E(bmx t)+P(bmx t))\nendarrayright=underline0\n\nwhere rho(bmxt) in mathbbR is the fluid density, bmV(bmxt) in mathbbR^d is the flow velocity, E(bmxt) in mathbbR is the total energy per unit volume, and the pressure is given for an ideal gas with constant specific heat as\n\nP(bmxt) = (gamma - 1)Big(E(bmxt) - frac12rho(bmxt) lVert bmV(bmxt)rVert^2Big)\n\nThe specific heat ratio is specified as a parameter γ::Float64, which must be greater than unity.\n\n\n\n\n\n","category":"type"},{"location":"#StableSpectralElements.jl","page":"Home","title":"StableSpectralElements.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"StableSpectralElements.jl, formerly known as CLOUD.jl (Conservation Laws on Unstructured Domains), is a Julia framework for the numerical solution of partial differential equations of the form","category":"page"},{"location":"","page":"Home","title":"Home","text":"partial_t underlineU(bmxt) + bmnabla_bmx cdot underlinebmF(underlineU(bmxt) bmnabla_bmxunderlineU(bmxt)) = underline0","category":"page"},{"location":"","page":"Home","title":"Home","text":"for t in (0T) with T in mathbbR^+  and bmx in Omega subset mathbbR^d, subject to appropriate initial and boundary conditions, where underlineU(bmxt) is the vector of solution variables and underlinebmF(underlineU(bmxt)bmnabla_bmxunderlineU(bmxt)) is the flux tensor containing advective and/or diffusive contributions.  These equations are spatially discretized on curvilinear unstructured grids using discontinuous spectral element methods in order to generate ODEProblem objects suitable for time integration using OrdinaryDiffEq.jl within the SciML ecosystem. StableSpectralElements.jl also includes postprocessing tools employing WriteVTK.jl for generating .vtu files, allowing for visualization of high-order numerical solutions on unstructured grids using ParaView or other software. Shared-memory parallelization is supported through multithreading.","category":"page"},{"location":"","page":"Home","title":"Home","text":"The functionality provided by StartUpDG.jl for the handling of mesh data structures, polynomial basis functions, and quadrature nodes is employed throughout this package. Moreover, StableSpectralElements.jl implements dispatched strategies for semi-discrete operator evaluation using LinearMaps.jl, allowing for the efficient matrix-free application of tensor-product operators.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Discretizations employing nodal as well as modal bases are implemented, with the latter allowing for efficient and low-storage inversion of the dense elemental mass matrices arising from curvilinear meshes through the use of weight-adjusted approximations. ","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"StableSpectralElements.jl is a registered Julia package (compatible with Julia versions 1.8 and higher) and can be installed by entering the following commands within the REPL:","category":"page"},{"location":"","page":"Home","title":"Home","text":"using Pkg; Pkg.add(\"StableSpectralElements\")","category":"page"},{"location":"#Examples","page":"Home","title":"Examples","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"We recommend that users refer to the following Jupyter notebooks (included in the examples directory) for examples of how to use StableSpectralElements.jl:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Linear advection-diffusion equation in 1D\nLinear advection equation in 2D\nIsentropic Euler vortex in 2D\nLinear advection equation in 3D","category":"page"},{"location":"#License","page":"Home","title":"License","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This software is released under the GPLv3 license.","category":"page"}]
